function VisaCheckout(t){this.apiKey=t,this.transactionAmount=0,this.transactionCurrency=""}VisaCheckout.prototype.init=function(t){V.init({apikey:this.apiKey,paymentRequest:{currencyCode:this.transactionCurrency,subtotal:this.transactionAmount}}),V.on("payment.success",t),V.on("payment.cancel",this.onCancelCallback),V.on("payment.error",this.onErrorCallback)},VisaCheckout.prototype.onCancelCallback=function(t){console.warn(JSON.stringify(t))},VisaCheckout.prototype.onErrorCallback=function(t){console.error(JSON.stringify(t))},VisaCheckout.prototype.setTransactionAmount=function(t){this.transactionAmount=t},VisaCheckout.prototype.setTransactionCurrency=function(t){this.transactionCurrency=t};